  /// The previous state of the instance.
  final InstanceState previousState;

  InstanceStateChange({
    this.currentState,
    this.instanceId,
    this.previousState,
  });
}

enum InstanceStateName {
  pending,
  running,
  shuttingDown,
  terminated,
  stopping,
  stopped,
}

